import React from 'react';
import PropTypes from 'prop-types'
const foodILike = [
  {
    id: 1,
    food_name: 'Kimchi',
    picture: 'data:image/jpeg;base64,',
    rating: 5.0
  },
  {
    id: 2,
    food_name: 'Bibimbap',
    picture: 'data:image/jpeg;base64,',
    rating: 4.9
  },
];

function Food({ food_name, picture, rating }) {
  return (
    <div>
      <h2> I Like {food_name} </h2>
      <img src={picture} alt={food_name} />
      <h4> {rating}/5.0</h4>      
    </div>
  );
}

// map 내장 배열 함수를 사용
function App() {
  return (
    <div className="APP">
      <h1>Hello My React App</h1>
      {foodILike.map(dish =>
      (<Food key={dish.id}
        food_name={dish.food_name}
        picture={dish.picture}
        rating={dish.rating}
      />))}
    </div>
  );
}
음
// propTypes 를 사용하여 Food function에 보낼 데이터의 타입을 체크
// isRequired 가 없다면 데이터가 없는경우도상관없음
Food.propTypes = {
  food_name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number
}

export default App;
